import React, { useState, useEffect } from "react";
import {initializeTranscoding} from "./services"
import './App.css';

function App() {
  const [userState, setUserState] = useState({

    data: {},
    error: "",

  });

  const handleSearch = (data ) => {
    setUserState({
      data: data,
    });
  };

  const handleError = (error) => {
    setUserState({
      error: error,
    });
  };

  let content;
  let searchPokemon;
  let pokemonCard;
  let errorContent;

  const performFetching = () => {
    userState.error = "";

    initializeTranscoding()
      .then((data) => {
        userState.error = "";
        console.log(data)
      })
      .catch((err) => {

      });
  };
  return (
    <div className="App">
      <button className="add" onClick={performFetching}>
        Show Converted Vedio
      </button>
    </div>
  );
}

export default App;
